import{f as e}from"./app.edc637f8.js";import{_ as a}from"./plugin-vue_export-helper.21dcd24c.js";const o={},r=e('<h1 id="mybatis-springboot\u6E90\u7801\u89E3\u6790" tabindex="-1"><a class="header-anchor" href="#mybatis-springboot\u6E90\u7801\u89E3\u6790" aria-hidden="true">#</a> Mybatis-SpringBoot\u6E90\u7801\u89E3\u6790</h1><h1 id="\u5173\u952E\u7C7B" tabindex="-1"><a class="header-anchor" href="#\u5173\u952E\u7C7B" aria-hidden="true">#</a> \u5173\u952E\u7C7B</h1><h2 id="mybatisproperties" tabindex="-1"><a class="header-anchor" href="#mybatisproperties" aria-hidden="true">#</a> MybatisProperties</h2><p><code>org.mybatis.spring.boot.autoconfigure.MybatisProperties</code></p><p>MyBatis \u7684\u914D\u7F6E\u7C7B\uFF0C\u901A\u8FC7 Spring Boot \u4E2D\u7684 <code>@ConfigurationProperties</code> \u6CE8\u89E3\uFF0C\u6CE8\u5165 MyBatis \u7684\u76F8\u5173\u914D\u7F6E</p><p>\u8FD9\u91CC\u6CE8\u610F\u5230\u4EC5\u6DFB\u52A0\u4E86 @ConfigurationProperties \u6CE8\u89E3\uFF0C\u5728\u4F5C\u4E3A Spring Bean \u6CE8\u5165\u5230 Spring \u5BB9\u5668\u4E2D\u65F6\uFF0C\u4F1A\u5C06\u76F8\u5173\u914D\u7F6E\u6CE8\u5165\u5230\u5C5E\u6027\u4E2D\uFF0C\u4F46\u662F\u8FD9\u4E2A\u6CE8\u89E3\u4E0D\u4F1A\u5C06\u8BE5\u7C7B\u4F5C\u4E3A Spring Bean \u8FDB\u884C\u6CE8\u5165\uFF0C\u9700\u8981\u7ED3\u5408 @Configuration \u6CE8\u89E3\u6216\u8005\u5176\u4ED6\u6CE8\u89E3\u4E00\u8D77\u4F7F\u7528</p><h2 id="mybatisautoconfiguration" tabindex="-1"><a class="header-anchor" href="#mybatisautoconfiguration" aria-hidden="true">#</a> MybatisAutoConfiguration</h2><p><code>org.mybatis.spring.boot.autoconfigure.MybatisAutoConfiguration</code></p><p>\u5B9E\u73B0 InitializingBean \u63A5\u53E3\uFF0CMyBatis \u81EA\u52A8\u914D\u7F6E\u7C7B\uFF0C\u7528\u4E8E\u521D\u59CB\u5316 MyBatis\uFF0C\u6838\u5FC3\u7C7B</p><p>\u7C7B\u4E0A\u9762\u5B9A\u4E49\u7684\u51E0\u4E2A\u6CE8\u89E3\uFF1A</p><ul><li><p><code>@Configuration</code>\uFF1A\u53EF\u4EE5\u5F53\u4F5C\u4E00\u4E2A Spring Bean \u6CE8\u5165\u5230 Spring \u4E0A\u4E0B\u6587\u4E2D</p></li><li><p><code>@ConditionalOnClass({ SqlSessionFactory.class, SqlSessionFactoryBean.class }) </code>\u4FDD\u8BC1\u5B58\u5728 value \u4E2D\u6240\u6709\u7684 Class \u5BF9\u8C61\uFF0C\u4EE5\u786E\u4FDD\u53EF\u4EE5\u521B\u5EFA\u5B83\u4EEC\u7684\u5B9E\u4F8B\u5BF9\u8C61\uFF0C\u8FD9\u91CC\u5C31\u4FDD\u8BC1 SqlSessionFactory \u548C SqlSessionFactoryBean \u90FD\u80FD\u591F\u88AB\u521B\u5EFA</p></li><li><p><code>@ConditionalOnSingleCandidate(DataSource.class) </code>\u4FDD\u8BC1\u5B58\u5728 value \u7C7B\u578B\u5BF9\u5E94\u7684 Bean\uFF0C\u8FD9\u91CC\u786E\u4FDD\u5DF2\u7ECF\u5B58\u5728\u4E00\u4E2A DataSource \u6570\u636E\u6E90\u5BF9\u8C61</p></li><li><p><code>@EnableConfigurationProperties(MybatisProperties.class) </code>\u6CE8\u5165 value \u4E2D\u6240\u6709\u7684\u7C7B\u578B\u7684 Bean\uFF0C\u8FD9\u91CC\u4F1A\u8BA9 MybatisProperties \u4F5C\u4E3A Spring Bean \u6CE8\u5165\u5230 Spring \u4E0A\u4E0B\u6587\u4E2D</p></li></ul><h2 id="sqlsessiontemplate" tabindex="-1"><a class="header-anchor" href="#sqlsessiontemplate" aria-hidden="true">#</a> SqlSessionTemplate</h2><p><code>org.mybatis.spring.SqlSessionTemplate</code>\uFF1A\u5B9E\u73B0 SqlSession \u548C DisposableBean \u63A5\u53E3\uFF0CSqlSession \u64CD\u4F5C\u6A21\u677F\u5B9E\u73B0\u7C7B \u5B9E\u9645\u4E0A\uFF0C\u4EE3\u7801\u5B9E\u73B0\u548C <code>org.apache.ibatis.session.SqlSessionManager</code> \u76F8\u4F3C\uFF0C\u627F\u62C5 SqlSessionFactory \u548C SqlSession \u7684\u804C\u8D23</p><h3 id="sqlsessioninterceptor" tabindex="-1"><a class="header-anchor" href="#sqlsessioninterceptor" aria-hidden="true">#</a> SqlSessionInterceptor</h3><p>SqlSessionTemplate\u7684\u5185\u90E8\u7C7B\uFF0C\u5B9E\u73B0\u4E86 InvocationHandler \u63A5\u53E3\uFF0C\u4F5C\u4E3A<code>sqlSessionProxy</code>\u52A8\u6001\u4EE3\u7406\u5BF9\u8C61\u7684\u4EE3\u7406\u7C7B\uFF0C\u5BF9 SqlSession \u7684\u76F8\u5173\u65B9\u6CD5\u8FDB\u884C\u589E\u5F3A</p><h2 id="mapperfactorybean" tabindex="-1"><a class="header-anchor" href="#mapperfactorybean" aria-hidden="true">#</a> MapperFactoryBean</h2><p>\u626B\u63CF Mapper \u63A5\u53E3\u65F6\u751F\u6210\u7684<code>BeanDefinition</code>\u5BF9\u8C61\uFF0C\u901A\u8FC7\u8FD9\u4E2A\u5BF9\u8C61\uFF0Cspring\u751F\u6210bean\u7684\u8FC7\u7A0B\u5B8C\u6210\u4E86<strong>Mapper \u52A8\u6001\u4EE3\u7406\u5BF9\u8C61\u7684\u521B\u5EFA</strong>\u3002</p><h3 id="\u521B\u5EFAmappedstatement" tabindex="-1"><a class="header-anchor" href="#\u521B\u5EFAmappedstatement" aria-hidden="true">#</a> \u521B\u5EFAMappedStatement</h3><p><code>MapperFactoryBean</code>\u7684\u7236\u7C7B<code>DaoSupport</code>\u4E2D\u5B9E\u73B0\u4E86<code>InitializingBean</code>\u63A5\u53E3\uFF0C\u5728\u521B\u5EFAbean\uFF0C\u521D\u59CB\u5316\u65F6\u4F1A\u8C03\u7528<code>checkDaoConfig</code>\u65B9\u6CD5\u6765\u751F\u6210<code>MappedStatement</code>\u653E\u5728\u5168\u5C40\u914D\u7F6E\u7C7B<code>Configuration</code>\u4E2D\u3002</p><h3 id="\u521B\u5EFAmapper\u4EE3\u7406\u7C7B" tabindex="-1"><a class="header-anchor" href="#\u521B\u5EFAmapper\u4EE3\u7406\u7C7B" aria-hidden="true">#</a> \u521B\u5EFAMapper\u4EE3\u7406\u7C7B</h3><p><code>MapperFactoryBean </code>\u5B9E\u73B0\u4E86<code>FactoryBean</code>\u63A5\u53E3\uFF0C\u5728spring\u6846\u67B6\u521D\u59CB\u5316\u65F6\uFF0C\u4F1A\u901A\u8FC7<code>FactoryBean#getObject</code>\u751F\u6210\u5E76\u83B7\u53D6Mapper\u63A5\u53E3\u7684\u4EE3\u7406\u5BF9\u8C61\u3002</p><p><code>getObject</code>\u901A\u8FC7getSqlSession \u65B9\u6CD5\u83B7\u53D6\u7236\u7C7B<code>SqlSessionDaoSupport</code>\u4E2D\u7684<code>sqlSessionTemplate</code>\uFF0C\u901A\u8FC7sqlSession\u751F\u6210\u5E76\u83B7\u53D6Mapper\u63A5\u53E3\u7684\u4EE3\u7406\u5BF9\u8C61\u3002</p><h1 id="mapperscan\u6CE8\u89E3" tabindex="-1"><a class="header-anchor" href="#mapperscan\u6CE8\u89E3" aria-hidden="true">#</a> @MapperScan\u6CE8\u89E3</h1><p>Spring boot\u4E2D\uFF0C\u914D\u7F6E\u4E86<code>@Mapper</code>\u6CE8\u89E3\u7684Mapper\u63A5\u53E3\u624D\u4F1A\u88AB\u89E3\u6790\uFF0C\u4E00\u822C\u6709\u56DB\u4E2A\u8DEF\u5F84\uFF1A</p><ul><li><p>\u914D\u7F6E <code>MapperScannerConfigurer</code> \u626B\u63CF\u5668\u7C7B\u578B\u7684 Spring Bean</p></li><li><p><code>@MapperScan</code>\u6CE8\u89E3</p></li><li><p><code>&lt;mybatis:scan /&gt;</code>\u6807\u7B7E</p></li><li><p>\u82E5\u6CA1\u6709\u914D\u7F6E\u4E0A\u9762\u4E09\u79CD\u65B9\u5F0F\u5219\u901A\u8FC7<code>AutoConfiguredMapperScannerRegistrar</code>\u6DFB\u52A0<code>MapperScannerConfigurer</code>\uFF0C\u7136\u540E\u626B\u63CFSpring Boot\u7684\u57FA\u7840\u5305\u8DEF\u5F84\u53BB\u83B7\u53D6Mapper\u63A5\u53E3\u3002</p></li></ul><p><code>org.mybatis.spring.annotation.MapperScannerRegistrar</code>\u4F5C\u4E3A<code>@MapperScan</code>\u7684\u6CE8\u518C\u5668\u3002</p><p><code>MapperScannerRegistrar</code> \u5B9E\u73B0\u4E86 <code>ImportBeanDefinitionRegistrar</code>\u63A5\u53E3\uFF0C\u5728Spring Boot\u521B\u5EFAbean\u65F6\uFF0C\u8C03\u7528\u65B9\u6CD5registerBeanDefinitions\u521B\u5EFA\u4E86<code>MapperScannerConfigurer</code>\u5BF9\u8C61\uFF0C<code>MapperScannerConfigurer</code>\u4F7F\u7528<code>@MapperScan</code>\u6CE8\u89E3\u4FE1\u606F\u53BB\u626B\u63CFMapper\u63A5\u53E3\u3002</p><blockquote><p><code>MapperScannerConfigurer</code>\u626B\u63CF\u5230\u7684\u6240\u6709\u626B\u63CF\u5230\u7684 Mapper \u63A5\u53E3\u7684 <code>BeanDefinition </code>\u5BF9\u8C61\uFF08Spring Bean\u7684\u524D\u8EAB\uFF09\uFF0C\u5E76\u5C06\u5176 Bean Class \u4FEE\u6539\u4E3A <code>MapperFactoryBean</code>\uFF0C\u4ECE\u800C\u5728 Spring \u521D\u59CB\u5316\u8BE5 Bean \u7684\u65F6\u5019\uFF0C\u4F1A\u521D\u59CB\u5316\u6210 <code>MapperFactoryBean</code> \u7C7B\u578B\uFF0C<strong>\u5B9E\u73B0\u521B\u5EFA Mapper \u52A8\u6001\u4EE3\u7406\u5BF9\u8C61</strong></p></blockquote><h2 id="autoconfiguredmapperscannerregistrar" tabindex="-1"><a class="header-anchor" href="#autoconfiguredmapperscannerregistrar" aria-hidden="true">#</a> AutoConfiguredMapperScannerRegistrar</h2><p><code>org.mybatis.spring.boot.autoconfigure.MybatisAutoConfiguration.AutoConfiguredMapperScannerRegistrar</code></p><p>\u662F<code>MybatisAutoConfiguration</code> \u7684\u4E00\u4E2A\u5185\u90E8\u9759\u6001\u7C7B\u3002</p><p>\u901A\u8FC7<code>org.mybatis.spring.boot.autoconfigure.MybatisAutoConfiguration.MapperScannerRegistrarNotFoundConfiguration</code>\u5BFC\u5165\u8BE5bean\uFF08\u901A\u8FC7\u6761\u4EF6\u6CE8\u89E3\u5224\u65AD\u4E86\u4E0D\u5B58\u5728\u53E6\u5916\u4E09\u79CD\u8DEF\u5F84\u7684\u524D\u63D0\uFF09\u3002</p>',32);function i(n,p){return r}var s=a(o,[["render",i]]);export{s as default};
